import{_ as e}from"./plugin-vue_export-helper.21dcd24c.js";import{o,c as t,a as i}from"./app.38166bb6.js";const a={},s=i('<h1 id="proposal-15-motion-17-\u4E3A\u9519\u8FC7\u7684\u4EBA\u6253\u5F00\u4EA4\u6362" tabindex="-1"><a class="header-anchor" href="#proposal-15-motion-17-\u4E3A\u9519\u8FC7\u7684\u4EBA\u6253\u5F00\u4EA4\u6362" aria-hidden="true">#</a> Proposal 15/Motion 17: \u4E3A\u9519\u8FC7\u7684\u4EBA\u6253\u5F00\u4EA4\u6362</h1><div class="custom-container tip"><p class="custom-container-title">\u63D0\u793A</p><p>Reddit link: https://www.reddit.com/r/DBC_Council/comments/rkrcpu/proposal_15_motion_17_open_the_swap_for_people/</p></div><h2 id="title-open-the-swap-for-people-that-missed-it" tabindex="-1"><a class="header-anchor" href="#title-open-the-swap-for-people-that-missed-it" aria-hidden="true">#</a> Title: Open the swap for people that missed it</h2><p>The council will vote whether or not to open the swap for people that missed the scheduled swap. If approved, the swap will be open for applications for one week. During that week, those who hold nep5 (NEO) coins can submit a request for the swap and receive Mainnet coins through the same process used during the scheduled swap. After one week, the swap will be closed again.</p><p>Vote for &quot;aye&quot; to approve a limited, one-week swap. Vote against &quot;nay&quot; to not open the swap for those who missed it.</p><p>Pros</p><ul><li><p>crazysix has a list of 100 holders that missed the swap. These holders add up to millions of coins. Allowing them to swap will show the community and the team are here to support them and help create a positive reputation for DBC.</p></li><li><p>We will have more community members holding Mainnet coins who can participate in staking, democracy, and more. The more involved holders the stronger DBC will become.</p></li></ul><p>Cons</p><ul><li>Opening the swap does require time and energy from the foundation, which distracts from other efforts. However, this is why we are restricting the window for one week. We could vote for another window in the future.</li></ul><p>If the council does not vote for or against this proposal, it will be reopened in the near future.</p><p>Extra consideration: KuCoin dropped the ball and I (crazysix) feel a late swap option is necessary for those who missed the swap, especially those who expected KuCoin to handle it.</p><h2 id="\u6807\u9898-\u4E3A\u9519\u8FC7\u7684\u4EBA\u6253\u5F00\u4EA4\u6362" tabindex="-1"><a class="header-anchor" href="#\u6807\u9898-\u4E3A\u9519\u8FC7\u7684\u4EBA\u6253\u5F00\u4EA4\u6362" aria-hidden="true">#</a> \u6807\u9898\uFF1A \u4E3A\u9519\u8FC7\u7684\u4EBA\u6253\u5F00\u4EA4\u6362</h2><p>\u7406\u4E8B\u4F1A\u5C06\u6295\u7968\u51B3\u5B9A\u662F\u5426\u4E3A\u9519\u8FC7\u9884\u5B9A\u4EA4\u6362\u7684\u4EBA\u5F00\u653E\u4EA4\u6362\u3002\u5982\u679C\u83B7\u5F97\u6279\u51C6\uFF0C\u4E92\u6362\u5C06\u5F00\u653E\u7533\u8BF7\u4E00\u5468\u3002\u5728\u90A3\u4E00\u5468\u5185\uFF0C\u6301\u6709 nep5 (NEO) \u5E01\u7684\u4EBA\u53EF\u4EE5\u63D0\u4EA4\u4EA4\u6362\u8BF7\u6C42\uFF0C\u5E76\u901A\u8FC7\u9884\u5B9A\u4EA4\u6362\u671F\u95F4\u4F7F\u7528\u7684\u76F8\u540C\u6D41\u7A0B\u63A5\u6536\u4E3B\u7F51\u5E01\u3002\u4E00\u5468\u540E\uFF0C\u4EA4\u6362\u5C06\u518D\u6B21\u5173\u95ED\u3002</p><p>\u6295\u7968\u201C\u540C\u610F\u201D\u4EE5\u6279\u51C6\u4E3A\u671F\u4E00\u5468\u7684\u6709\u9650\u4EA4\u6362\u3002\u6295\u7968\u53CD\u5BF9\u201C\u4E0D\u201D\uFF0C\u4E0D\u4E3A\u90A3\u4E9B\u9519\u8FC7\u5B83\u7684\u4EBA\u6253\u5F00\u4EA4\u6362\u3002</p><p>\u4F18\u70B9</p><ul><li><p>crazysix \u5217\u51FA\u4E86 100 \u540D\u9519\u8FC7\u6389\u671F\u7684\u6301\u6709\u8005\u3002\u8FD9\u4E9B\u6301\u6709\u8005\u52A0\u8D77\u6765\u6709\u6570\u767E\u4E07\u4E2A\u786C\u5E01\u3002\u5141\u8BB8\u4ED6\u4EEC\u4EA4\u6362\u5C06\u8868\u660E\u793E\u533A\u548C\u56E2\u961F\u5728\u8FD9\u91CC\u652F\u6301\u4ED6\u4EEC\u5E76\u5E2E\u52A9\u4E3A DBC \u521B\u9020\u79EF\u6781\u7684\u58F0\u8A89\u3002</p></li><li><p>\u6211\u4EEC\u5C06\u6709\u66F4\u591A\u7684\u793E\u533A\u6210\u5458\u6301\u6709\u4E3B\u7F51\u5E01\uFF0C\u4ED6\u4EEC\u53EF\u4EE5\u53C2\u4E0E Staking\u3001\u6C11\u4E3B\u7B49\u3002\u53C2\u4E0E\u7684\u6301\u6709\u8005\u8D8A\u591A\uFF0CDBC \u5C31\u4F1A\u53D8\u5F97\u8D8A\u5F3A\u5927\u3002</p></li></ul><p>\u7F3A\u70B9</p><ul><li>\u6253\u5F00\u4EA4\u6362\u786E\u5B9E\u9700\u8981\u57FA\u91D1\u4F1A\u7684\u65F6\u95F4\u548C\u7CBE\u529B\uFF0C\u8FD9\u4F1A\u5206\u6563\u5176\u4ED6\u5DE5\u4F5C\u7684\u6CE8\u610F\u529B\u3002\u4F46\u662F\uFF0C\u8FD9\u5C31\u662F\u6211\u4EEC\u5C06\u7A97\u53E3\u9650\u5236\u4E3A\u4E00\u5468\u7684\u539F\u56E0\u3002\u6211\u4EEC\u53EF\u4EE5\u6295\u7968\u652F\u6301\u672A\u6765\u7684\u53E6\u4E00\u4E2A\u7A97\u53E3\u3002</li></ul><p>\u5982\u679C\u7406\u4E8B\u4F1A\u4E0D\u6295\u7968\u8D5E\u6210\u6216\u53CD\u5BF9\u8BE5\u63D0\u6848\uFF0C\u5B83\u5C06\u5728\u4E0D\u4E45\u7684\u5C06\u6765\u91CD\u65B0\u5F00\u653E\u3002</p><p>\u989D\u5916\u7684\u8003\u8651\uFF1AKuCoin \u5931\u8D25\u4E86\uFF0C\u6211\uFF08crazysix\uFF09\u89C9\u5F97\u5BF9\u4E8E\u90A3\u4E9B\u9519\u8FC7\u4EA4\u6362\u7684\u4EBA\u6765\u8BF4\uFF0C\u5EF6\u8FDF\u4EA4\u6362\u9009\u9879\u662F\u5FC5\u8981\u7684\uFF0C\u5C24\u5176\u662F\u90A3\u4E9B\u5E0C\u671B KuCoin \u5904\u7406\u5B83\u7684\u4EBA\u3002</p>',20),p=[s];function r(n,h){return o(),t("div",null,p)}var c=e(a,[["render",r],["__file","15.html.vue"]]);export{c as default};
